void process_platform(struct platform *p)
{
  if (jump_distance > 0)
  {
    p->pos -= moving_speed;
  }
  if (p->pos + p->width / 2 <= 0)
  {
    p->width = rand() % difficulty + 10;
    p->pos = SCREEN_WIDTH + p->width / 2;
  }
}

void process_player(struct chess *p)
{
  if (jump_distance > 0)
  {
    p->y = 118 - get_jump_height(jump_distance, initial_distance);
  }
}

bool is_player_on_platform(struct chess *c, struct platform p) {
  int ptop = SCREEN_HEIGHT - p.height;
  int pleft = p.pos - p.width / 2;
  int pright = p.pos + p.width / 2;
  int cbottom = c->y + 22;

  if (cbottom >= ptop - 2 && cbottom <= ptop + 2) {
    if (c->x >= pleft && c->x <= pright) {
      return true;
    }
  }
  return false;
}

